import ReactDOM from 'react-dom';

const num=7;
const name="macmuka";

ReactDOM.render(
  <div>
     <h1>My Favorite Food</h1>
    <ul>
   <li>Food 1</li>
   <li>Food 2</li>
   <li>Food 3</li>
 </ul> 
<h1>Hello {name}</h1>
<p>Your lucky number is {num}</p>
  </div>
 ,
